{-# OPTIONS -Wall #-}

module CardGamesTests where

import CardGames

import System.IO
import Test.HUnit
import Text.Printf

{- ************************************************************ -}
{- ************************************************************ -}

{-

At the `ghci` prompt, can run individual tests like:

    *CardGamesTests> runTestTT pokerHandCompareTests

At the `ghci` prompt, can run all tests and report grade like:

    *CardGamesTests> main

At the shell prompt, can run all tests and report grade like:

    $ runhaskell CardGamesTests.hs

-}

main :: IO ()
main = do grades <- mapM scoreTest [("pokerHandCompare", pokerHandCompareTests),
                                    ("texasHold'emShowdownCompare", texasHold'emShowdownCompareTests),
                                    ("cribbageScoreTheShow", cribbageScoreTheShowTests),
                                    ("cribbageScoreThePlay", cribbageScoreThePlayTests)]
          putStrLn "\n"
          mapM_ putStrLn grades

scoreTest :: (String, Test) -> IO String
scoreTest (title, testCases) =
  do hPutStrLn stderr ("Testing " ++ title)
     Counts {cases = _, tried = ts, errors = es, failures = fs} <- runTestTT testCases
     let pts = 20 :: Integer
     let (lo,hi) = (3.0,17.0)
     let ratio = fromIntegral (ts - es - fs) / fromIntegral ts
     let scr | es + fs == 0  = fromIntegral pts
             | es + fs == ts = 0.0 :: Double
             | otherwise     = lo + (hi - lo) * ratio
     let grade = concat [printf "%.3f" scr, "/", show pts,
                         ": ", title, " (correctness)",
                         " [", show (ts - es - fs), "/", show ts, "]"]
     hPutStrLn stderr grade
     return grade

{- ************************************************************ -}
{- ************************************************************ -}

pokerHandCompareTests :: Test
pokerHandCompareTests =
  TestList (map mkTest pokerHandCompareTestCases)
  where mkTest (hand1, hand2, ans) = label ~: pokerHandCompare hand1 hand2 ~?= ans
          where label = concat ["pokerHandCompare ", show hand1, " ", show hand2, " ~?= ", show ans]

texasHold'emShowdownCompareTests :: Test
texasHold'emShowdownCompareTests =
  TestList (map mkTest texasHold'emShowdownCompareTestCases)
  where mkTest (comm, hand1, hand2, ans) = label ~: texasHold'emShowdownCompare comm hand1 hand2 ~?= ans
          where label = concat ["texasHold'emShowdownCompare ", show comm, show hand1, " ", show hand2, " ~?= ", show ans]

cribbageScoreTheShowTests :: Test
cribbageScoreTheShowTests =
  TestList (map mkTest cribbageScoreTheShowTestCases)
  where mkTest (cst, crib, hand, ans) = label ~: cribbageScoreTheShow cst crib hand ~?= ans
          where label = concat ["cribbageScoreTheShow (", show cst, ") ", show crib, " ", show hand, " ~?= ", show ans]

cribbageScoreThePlayTests :: Test
cribbageScoreThePlayTests =
  TestList (map mkTest cribbageScoreThePlayTestCases)
  where mkTest (play, ans) = label ~: cribbageScoreThePlay play ~?= ans
          where label = concat ["cribbageScoreThePlay ", show play, " ~?= ", show ans]

